  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Oxbow NWR for the next 15 years. This plan outlines
  the Refuge vision and purpose and describes how Oxbow NWR will contribute to the
  overall mission of the Refuge System. The plan provides an introduction to the Refuge,
  an overview of the CCP process, a summary of Refuge resources, information about
  the management direction, and administration. Key planning issues include: wildlife
  management, habitat management, public use, control of invasive species, hunting,
  resource protection, and operations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
